webpackJsonp([52306936332150],{"./node_modules/json-loader/index.js!./.cache/json/cv.json":function(e,n){e.exports={data:{markdownRemark:{fileAbsolutePath:"/home/travis/build/Necmttn/necmttn.github.io/packages/necmttn-gatsby/src/pages/cv.md",html:'<h1>Necmettin Karakaya</h1>\n<p>Self-taough Software Engineer</p>\n<html><head></head><body><div id="webaddress">\n<a href="necmttin.karakaya@gmail.org">necmettin.karakaya@gmail.com</a>\n| <a href="necmttn.surge.sh">Personal website</a>\n</div></body></html>\n<h2>Currently</h2>\n<p>Working at <a href="http://meshtech.co">Mesh</a> mainly responsible of maintaining Electron based desktop application. While\nmaintaining in-house JS library for generating smart business logic JS packages for IOS, Android devices.</p>\n<h3>Specialized in</h3>\n<p>ReactjS, VueJs, ElectronJs, Graphql, styled-compontents. basicly all the cool feature Front-End tech stack. But really wanna build something Cool with GoLang. Would love to work with the team uses. </p>\n<h3>Research interests</h3>\n<p>Decentralized Applications, AI, Micro Services, The Cool new thing.</p>\n<h2>Education</h2>\n<p><code>2008 - 2012</code>\n<strong>Antalya High School, Antalya, Turkey</strong> - Math &#x26; Science major.</p>\n<p><code>2012 - 2013</code>\n<strong>Shanghai University, Shanghai, China</strong> - Chinese Language Program</p>\n<p><code>2013 - 2014</code>\n<strong>South China University of Technology, Guangzhou, China</strong> - International Trade &#x26; Chinese Language Program</p>\n<ul>\n<li>During the my education in SCUT. I had economical problems. Because of that i had to find a way to make smart way\nmoney. This was the first time. I Start making H5 websites as a my professional job. </li>\n</ul>\n<p><code>2015 - 2017</code>\n<strong>Guangzhou University, Guangzhou, China</strong> - Architecture Faculty</p>\n<ul>\n<li>After a year of break from studying for working at Multinational Architect firm. it’s influenced me to study\narchitecture. I was planing to combine my software knowledge with archictectural depth sense &#x26; and design. to develop AR\n/ VR applications.</li>\n<li>but eventually i realized that in Architecture faculty they also teach bunch of unrelated skill then what i want.</li>\n<li>so I drop out.</li>\n</ul>\n<p><code>2017 - now</code>\n<strong>Guangzhou University, Guangzhou, China</strong> - Computer Science Faculty</p>\n<ul>\n<li>So eventually i settle down in Computer Science faculty. while working professional freelancer :)</li>\n<li>if you curios what’s the reason keeping me just don’t. (it’s helps me to get Visa for china. &#x26; come on in some part of\nthe world the diploma is still matter.)</li>\n</ul>\n<h3>Journals</h3>\n<p><code>1669</code>\nNewton Sir I, De analysi per æquationes numero terminorum infinitas. </p>\n<p><code>1669</code>\nLectiones opticæ.</p>\n<p>etc. etc. etc.</p>\n<h3>Certificates</h3>\n<p><code>2012</code>\nInfinitesimal calculus for solutions to physics problems, <a href="http://www.techdirt.com/articles/20121011/09312820678/if-patents-had-been-around-time-newton.shtml">SMBC</a> patent 001</p>\n<h2>Occupation</h2>\n<p><code>2013 Feb - 2013 Apr</code>\n<strong>Efes Restaurant</strong>, Shanghai, China</p>\n<ul>\n<li>Saloon &#x26; Kitchen Coordinator.</li>\n</ul>\n<p><code>2014</code>\n<strong>Guangzhou Rehberi</strong>, Freelance</p>\n<ul>\n<li>Wordpress Website.</li>\n<li>A website for help people find a Translator in guangzhou. And blog with usefull information about Guangzhou. </li>\n<li>Targeted Turkish People</li>\n</ul>\n<p><code>2015</code>\n<strong>Bambu Atolyesi</strong>, Freelance</p>\n<ul>\n<li>Wordpress website for Online Furniture Shopping Mall.</li>\n</ul>\n<p><code>2015</code>\n<strong>Vanya Photo Studio</strong>, Freelance</p>\n<ul>\n<li>HTML5 website for Vanya Sacha Photographer / Filmmaker portfolio.</li>\n</ul>\n<p><code>2016</code>\n<strong>Ding apperaels</strong>, Freelance</p>\n<ul>\n<li>Wordpress website for Textile factory.</li>\n</ul>\n<p><code>2016</code>\n<strong>Chayhana Restaurant</strong>, Freelance</p>\n<ul>\n<li>Gatsby Static Progressive Web App. </li>\n<li>The target was having a offline accessiable website/app.</li>\n</ul>\n<p><code>2013 aug - 2016 dec</code>\n<strong>Delvento Home</strong>, Guangzhou, China</p>\n<ul>\n<li>IT Service Consultant.</li>\n<li>Build &#x26; Maintain Umbrella company websites.</li>\n<li>Responsible for Social Media.</li>\n<li>Project Manager for Tech Based projects.</li>\n</ul>\n<p><code>1600</code>\n<strong>Lucasian professor of Mathematics</strong>, Cambridge University</p>\n<!-- ### Footer\n\nLast updated: May 2013 --><html><head></head><body></body></html>',excerpt:"Necmettin Karakaya Self-taough Software Engineer Currently Working at  Mesh  mainly responsible of maintaining Electron based desktop…",frontmatter:{title:"Necmettin Karakaya's CV",til:null}}},pathContext:{path:"/cv/",langKey:"en"}}}});
